$half: 50%;
$transition: all .4s ease;

.header {
  //position:absolute;
  border-radius: 8px;
  min-height: 60px;
  margin: 25px auto;
  width: 90%;
  display: -o-flex;
  display: -moz-flex;
  display: -webkit-flex;
  display: flex;
  flex: 1 1 auto;
  flex-wrap: wrap;
  justify-content: flex-end;
}

.login {
  display: -o-flex;
  display: -moz-flex;
  display: -webkit-flex;
  display: flex;
  margin: 10% auto;
  flex-wrap: wrap;
  width: 30%;
  min-width: 150px;
  background: #fff;
  border-radius: 5px;
  border: 1px solid #ccc;
  box-shadow: 0 1px 2px rgba(0, 0, 0, .1);
}

.reg {
  @extend .login;
  color: antiquewhite;
  background: #fff;
}

.log-label {
  color: black;
  font-weight: bold;
  border: 1px;
  margin: 12px 10%;
}

.log-reg-btn {
  border-radius: 4px;
  border: 0;
  text-decoration: none;
  color: white;
  background: #282c34;
  text-align: center;
  margin: 10px auto;
  font-size: 16px;
  font-weight: bold;
  width: 30%;
  padding: 8px;
  cursor: pointer;
  transition: 0.4s;

  &:hover {
    box-shadow: 0 1px 10px 1px #78caf9, 0 1px 10px 1px #6dc0f3, 0 1px 10px 1px #2196f3, 0 1px 10px 1px #2196f3;
    background-color: #d5e2f3;
    transition-delay: 0.3s;
    color: black;
  }
}


.text-input {
  font-size: 16px;
  color: black;
  padding-left: 15px;
  margin: 12px 10%;
  width: 80%;
  height: 35px;
  border: 1px solid #c7d0d2;
  border-radius: 2px;
  box-shadow: inset 10px 2px 10px rgba(159, 217, 255, 0.7), 0 0 0 5px #f5f7f8;
  -webkit-transition: $transition;
  -moz-transition: $transition;
  transition: $transition;
}

